import "./BoutiqueMenu.css";
import { useDispatch } from "react-redux";

export default function BoutiqueMenu() {
  const dispatch = useDispatch();

  const afficheBonnet = () => {
    dispatch(fetchBonnet());
  };

  const afficheTourDeCou = () => {
    dispatch(fetchTourDeCou());
  };

  const affichePull = () => {
    dispatch(fetchPull());
  };

  const afficheGant = () => {
    dispatch(fetchGant());
  };

  const afficheChaussette = () => {
    dispatch(fetchChaussette());
  };

  const afficheChausson = () => {
    dispatch(fetchChausson());
  };

  const affichePlaide = () => {
    dispatch(fetchPlaide());
  };

  const affichePelote = () => {
    dispatch(fetchPelote());
  };

  return (
    <div className="container-boutique-menu">
      <div className="item" Onclick={afficheBonnet}>Bonnet</div>
      <div className="item"Onclick={afficheTourDeCou}>Tour de cou</div>
      <div className="item"Onclick={affichePull}>Pull</div>
      <div className="item"Onclick={afficheGant}>Gant</div>
      <div className="item"Onclick={afficheChaussette}>Chaussette</div>
      <div className="item"Onclick={afficheChausson}>Chausson</div>
      <div className="item"Onclick={affichePlaide}>Plaide</div>
      <div className="item"Onclick={affichePelote}>Pelote</div>
    </div>  
      )
      }
